USE OptimizeDB;

-- 큰 데이터셋을 위한 테이블 생성
CREATE TABLE LargeSales (
    SaleID INT PRIMARY KEY,
    EmployeeID INT,
    Product VARCHAR(100),
    SaleAmount DECIMAL(10, 2),
    SaleDate DATE,
